import React from 'react';
import TourCentrale from './TourCentrale';


const Skills = (props) => {
    return (
        <div className={border}>
            {
                    props.mesCompetences.map((itemUn) =>{
                        return(
                            <div className={itemUn.className}>
                                {
                                    props.mesCompetences.map((itemUn) =>{
                                        return(
                                            <ul>
                                                <li key={itemUn.id}>{itemUn.value}</li>
                                            </ul>
                                        )
                                    })
                                }
                            </div>
                        )
                    })
            }
            <TourCentrale/>
        </div>
    );
};

export default Skills;
